(4, 'Yvette Leech', 'counsellor@gmail.com', NULL, '$2y$10$gp8B9021cJAX3LePn900susBYBmENFvHdbFYIcXWtr7B47z7UcC8G', 'Male', 'I’m Yvette Leech, a Level 2 Clinical Counsellor, and I’m here to guide and support you as you navigate life’s complexities.Taking the first step to seek support is an act of immense courage, and making that initial appointment shows your readiness to face fears and embrace change. \r\n\r\nDrawing from my personal experiences, a bachelor’s degree, and advanced training in Emotionally Focused Therapy (EFT), I provide a supportive, non-judgmental space where you can feel safe to explore, grow, and heal. I specialise in trauma recovery, anxiety management, depression support, grief and loss, eating disorders, burnout, addiction. life transitions, emotion regulation and relationship dynamics.\r\n\r\nTogether, we’ll explore your emotional landscape, uncover deeper patterns, and identify coping mechanisms that may be holding you back. By understanding these patterns, I’ll help you shift from merely surviving to thriving, empowering you to build a fulfilling and balanced life. My science-based EFT approach fosters meaningful transformation, enhances self-awareness, and strengthens connections with others.\r\n\r\nI offer Zoom video sessions, ensuring a convenient and secure environment to support you on your journey toward resilience, wellbeing, and lasting change.', 'https://mindwayeap.com.au/setupnew', 'Pacific/Midway', '1737426834.png', '[\"\"]', '[\"Phone Call\",\"Video Call\"]', NULL, '2024-08-16 03:46:11', '2025-01-26 11:42:07', 0, NULL, '104699745504683605312', 'Samantha Wright', 'communications@mindwayeap.com.au', 'https://lh3.googleusercontent.com/a/ACg8ocLEvCZxltVijCah-UxEKMEF4G73kwtH7Hsff6VmwqLpbLjxiUk=s96-c', 12),
