(6, 'Happiness', 'This happiness meditation course on Mindway guides you to find inner peace and happiness through a variety of daily meditation techniques.', '1687784121.png', '2-10 min', '#FFE8BA', NULL, '2023-02-01 18:53:34', '2023-06-26 02:55:21'),
